/*****************************************************************************

#!/usr/bin/env ruby

O1_TAKE = 100

for n in 0..O1_TAKE do
    decl = (0..n-1).collect { |i| "typename A#{i}" } << "typename ...An"
    spec = (0..n-1).collect { |i| "A#{i}" } << "An..."
    take = (0..n-1).collect { |i| "A#{i}" }

    puts <<-END
template <#{decl.join(', ')}> \
struct take<#{n}, vector<#{spec.join(', ')}>> { \
    using type = vector<#{take.join(', ')}>; \
};
    END
end

*****************************************************************************/

static_assert(O1_TAKE == 100,
"You must keep this value synced with O1_TAKE in <boost/mpl11/args.hpp>");
